import React from 'react';
import LogoutButton from './../components/LogoutButton';

function CustomerDashboard() {
  const styles = {
    container: {
      minHeight: '100vh',
      display: 'flex',
      flexDirection: 'column',
      justifyContent: 'center',
      alignItems: 'center',
      padding: '20px',
      backgroundColor: '#f0f2f5',
    },
    card: {
      background: '#fff',
      padding: '40px',
      borderRadius: '12px',
      boxShadow: '0 4px 10px rgba(0,0,0,0.1)',
      textAlign: 'center',
      width: '100%',
      maxWidth: '400px',
    },
    heading: {
      fontSize: '24px',
      marginBottom: '20px',
      color: '#333',
    }
  };

  return (
    <div style={styles.container}>
      <div style={styles.card}>
        <h1 style={styles.heading}>Welcome, Customer!</h1>
        <LogoutButton />
      </div>
    </div>
  );
}

export default CustomerDashboard;
